import React, { Component } from 'react';
import './index.css';

class InputList extends Component {
    render() {
        return <footer>
            <div className="task">
                <div className="caption">Task: </div>
                <div className="inputTask">
                    <input type="text" placeholder="请输入一个Task" />
                </div>
            </div>
            <div className="submitBox">
                <input className="submit"  type="button" value="Save Task" />
            </div>
        </footer>
    }
}

export default InputList;
